import React, {FC} from 'react';
import LightBorderInput from "../../shared/ui/lightBorderInput/LightBorderInput";
import classes from './RegistrationForm.module.css'

const RegistrationForm: FC = () => {
    return (
        <div className={classes.registrationForm}>
            <form>
                <LightBorderInput type="text" placeholder="Введите номер телефона или почту"></LightBorderInput>
                <LightBorderInput type="text" placeholder="Введите пароль"></LightBorderInput>
                <span className={classes.infoText}>Забыли пароль?</span>
            </form>
        </div>
    );
};

export default RegistrationForm;
